Murchadh MacPharlain

Biography Documentary hosted by Iain Macleod, published by BBC in 2000 - Gaelic (Scottish) narration


Information
------------------------------

Award-winning documentary profiling Murdo MacFarlane, the Melbost Bard and renowned Gaelic poet and songwriter from the island of Lewis, whose work was a catalyst for a whole new era of modern Gaelic music. Having composed poems and songs all his life, it was not until the advent of the tape recorder that Murdo, who could neither read nor write music, became known to a wider audience. TV and radio archive recordings of Murdo in interviews and performing his work.

